import React from 'react';
import Swiper from 'react-id-swiper';
import homeIllustration1 from "../assets/screenshot1.jpeg"
import homeIllustration2 from "../assets/screenshot2.jpeg"
import homeIllustration3 from "../assets/screenshot3.jpeg"

const CarouselImage = styled.img`
  max-width: 57%;
  object-fit: cover;
  border-radius: 10px;
  @media (max-width: 768px) {
    width: auto;
  }
`;

const HomeCarousel = () => {
    const params = {
        effect: 'coverflow',
        grabCursor: true,
        centeredSlides: true,
        slidesPerView: 'auto',
        coverflowEffect: {
          rotate: 50,
          stretch: 0,
          depth: 100,
          modifier: 1,
          slideShadows: true
        },
        pagination: {
          el: '.swiper-pagination'
        }
      }     
      return (
        <Swiper {...params}>
          <CarouselImage src={homeIllustration1} />
          <CarouselImage src={homeIllustration2} />
          <CarouselImage src={homeIllustration3} />
        </Swiper>
      )
    };

export default HomeCarousel
